import "./css/main.css";

import React from "react";


const Main=(props)=>{
    
   

    return(
        <div className="main"> 
            <p>Este es el contenido principal de la aplicaci√≥n.</p>
         
            <div className="fila">
            </div > 
            {props.setproyecto === "primer" && <PrimerProjecto  />}
            {props.proyecto === "segundo" && <SegundoProjecto />} 
            {props.proyecto=== "tercer" && <TercerProjecto  />}
            </div>
    )
}

export default Main
